O cloridrato de propranolol é um betabloqueador indicado para: 
- controle de hipertensão (pressão alta); 
- controle de angina pectoris (sensação de pressão e dor no peito); 
- controle das arritmias cardíacas (alterações no ritmo dos batimentos cardíacos); 
- prevenção da enxaqueca (dor de cabeça forte); 
- controle do tremor essencial; 
- controle da ansiedade e taquicardia (aumento dos batimentos cardíacos) por ansiedade; 
- controle adjuvante da tireotoxicose (aumento da secreção da glândula tireoide) e crise tireotóxica; 
- controle da cardiomiopatia hipertrófica obstrutiva (aumento do volume do coração e problemas no seu funcionamento); 
- controle de feocromocitoma (tipo de tumor, geralmente benigno, localizado na glândula suprarrenal). Neste caso, o tratamento com cloridrato de propranolol deve apenas ser iniciado na presença de um bloqueio alfa efetivo. O cloridrato de propranolol é um medicamento betabloqueador, ou seja, inibe a estimulação dos receptores beta-adrenérgicos (beta-1 e beta-2) presentes no organismo (como no coração e nos vasos sanguíneos). O cloridrato de propranolol, assim como outros betabloqueadores, não deve ser utilizado na presença de: - conhecida hipersensibilidade (alergia) ao propranolol e aos outros componentes da fórmula; - hipotensão (pressão baixa); - bradicardia (diminuição dos batimentos cardíacos); - distúrbios graves da circulação arterial periférica (alterações na circulação sanguínea); - síndrome do nó sinoatrial (um tipo de arritmia cardíaca); - feocromocitoma (tipo de tumor, geralmente benigno, localizado na glândula suprarrenal) não tratado; - insuficiência cardíaca descompensada (problemas no funcionamento do coração); - angina de Prinzmetal (sensação de pressão e dor no peito em repouso); - choque cardiogênico (problemas graves na circulação do coração); - acidose metabólica (alto nível de ácidos no sangue); - após jejum prolongado; - bloqueio cardíaco de segundo ou terceiro grau (bloqueio nos impulsos elétricos do coração); - histórico de asma brônquica ou broncoespasmo (contrações nos brônquios do pulmão). O cloridrato de propranolol não deve ser utilizado por pacientes com predisposição à hipoglicemia, isto é, pacientes após jejum prolongado ou pacientes com reservas contraregulatórias restritas (nível de certos hormônios como glucagon e adrenalina).

O que é e para que serve? 
Um protetor diário sem fragância para usar todos os dias em que não estiver durante o período menstrual. CAREFREE® Todo dia é 100% respirável, flexível, absorve suor e fluidos natuais*, mantendo a área íntima seca e livre de odores.

Benefícios e diferenciais 
- 100% respirável para absorção de suor e fluidos naturais*;
- Não abafa a área íntima;
- Mantém a área íntima seca e arejada;
- Neutraliza odores;
- Hipoalergênico e ginecologicamente testado;

Como usar?
Descole a fita central e fixe o protetor diário no centro da calcinha. CAREFREE® Todo Dia deve ser trocado durante o dia, conforme necessidade de cada pessoa. 

Precauções 
Manter longe do alcance de crianças. Não compre se a embalgem estiver violada. Todos os componentes são atóxicos em contato com a pele. Descontinuar o uso em caso de irritação. Conservar em lugar fresco e seco. Não jogue no vaso sanitário. Utilize o cesto de lixo. 

*suor, sangramento de escape e outras secreções vaginais. Em casos de sensação  de ardência, coceira e/ou alterações no aspecto, cor, odor da secreção vaginal, consulte seu ginecologista.

O que é e para que serve? 
Um protetor diário com fragância para usar no comecinho e finalzinho da menstruação. 

Benefícios e diferenciais 
- 6 camadas protetoras que retém escapes de sangue;
- Mantém a área íntima seca e livre de odores;
- Neutraliza odores;
- Hipoalergênico e ginecologicamente testado;

Como usar? 
Descole a fita central e fixe o protetor diário no centro da calcinha. CAREFREE® Proteção deve ser trocado durante o dia, conforme necessidade de cada pessoa. 

Precauções 
Manter longe do alcance de crianças. Não compre se a embalgem estiver violada. Todos os componentes são atóxicos em contato com a pele. Descontinuar o uso em caso de irritação. Conservar em lugar fresco e seco. Não jogue no vaso sanitário. Utilize o cesto de lixo.

Absorvente para Incontinência Urinária TENA Lady Discreet Maxi Night Noturno faz parte da linha TENA Lady Discreet, produtos exclusivos para mulheres com incontinência urinária. 
Proteção diária para mulheres ativas com perda moderada de urina. TENA Lady Maxi Night foi especialmente projetado para proporcionar uma boa noite de sono. 
São macias e confortáveis favorecendo proteção adicional devido ao seu formato específico: são mais largas na parte de trás com maior área de cobertura e extra absorção quando deitado. 
•	Produto que você fixa na roupa íntima, evitando que ele se desloque com o movimento; 
•	Possui sistema Odour Control™ - Sistema de controle que reduz o risco de odores indesejáveis; 
•	Dry Fast Core™ - Núcleo de secagem rápida que absorve e retém o líquido mais rapidamente; 
•	Superfície com toque de tecido - Maior conforto e sensação de maciez; 
•	Absorve 9x mais que o absorvente menstrual garante segurança e excelente proteção contra vazamentos. 
•	Os componentes são atóxicos e pré-testados.

Este medicamento é indicado como analgésico (para dor) e antitérmico (para febre). 

Este medicamento não deve ser utilizado caso você tenha:
- reações alérgicas, tais como reações cutâneas graves com este medicamento;
- alergia ou intolerância à dipirona ou a qualquer um dos componentes da formulação ou a outras pirazolonas ou a pirazolidinas (ex.: fenazona, propifenazona, isopropilaminofenazona, fenilbutazona, oxifembutazona) incluindo, por exemplo, experiência prévia de agranulocitose (diminuição acentuada na contagem de glóbulos
brancos do sangue) com uma destas substâncias;
- função da medula óssea prejudicada (ex.: após tratamento citostático) ou doenças do sistema hematopoiético (responsável pela produção das células sanguíneas);
- desenvolvido broncoespasmo (contração dos brônquios levando a chiado no peito) ou outras reações anafilactoides, como urticária (erupção na pele que causa coceira), rinite (irritação e inflamação da mucosa do nariz), angioedema (inchaço em região subcutânea ou em mucosas) depois do uso de medicamentos para dor
(ex.: salicilatos, paracetamol, diclofenaco, ibuprofeno, indometacina, naproxeno);
- porfiria hepática aguda intermitente (doença metabólica que se manifesta através de problemas na pele e/ou com complicações neurológicas) pelo risco de indução de crises de porfiria;
- deficiência congênita da glicose-6-fosfato-desidrogenase (G6PD), pelo risco de hemólise (destruição dos glóbulos vermelhos, o que pode levar à anemia);
- gravidez e amamentação (vide “O que devo saber antes de usar este medicamento?”).
Este medicamento é contraindicado para menores de 3 meses de idade ou pesando menos de 5 kg.
Este medicamento não deve ser utilizado por mulheres grávidas sem orientação médica. Informe imediatamente seu médico em caso de suspeita de gravidez.

