- alergia ou intolerância à dipirona ou a qualquer um dos componentes da formulação ou a outras pirazolonas ou a pirazolidinas (ex.: fenazona, propifenazona, isopropilaminofenazona, fenilbutazona, oxifembutazona) incluindo, por exemplo, experiência prévia de agranulocitose (diminuição acentuada na contagem de glóbulos
brancos do sangue) com uma destas substâncias;
- função da medula óssea prejudicada (ex.: após tratamento citostático) ou doenças do sistema hematopoiético (responsável pela produção das células sanguíneas);
- desenvolvido broncoespasmo (contração dos brônquios levando a chiado no peito) ou outras reações
anafilactoides, como urticária (erupção na pele que causa coceira), rinite (irritação e inflamação da mucosa do
nariz), angioedema (inchaço em região subcutânea ou em mucosas) depois do uso de medicamentos para dor
(ex.: salicilatos, paracetamol, diclofenaco, ibuprofeno, indometacina, naproxeno);
- porfiria hepática aguda intermitente (doença metabólica que se manifesta através de problemas na pele e/ou com
complicações neurológicas) pelo risco de indução de crises de porfiria;
- deficiência congênita da glicose-6-fosfato-desidrogenase (G6PD), pelo risco de hemólise (destruição dos
glóbulos vermelhos, o que pode levar à anemia);
- gravidez e amamentação (vide “O que devo saber antes de usar este medicamento?”).
Este medicamento é contraindicado para menores de 3 meses de idade ou pesando menos de 5 kg.
Este medicamento não deve ser utilizado por mulheres grávidas sem orientação médica. Informe
imediatamente seu médico em caso de suspeita de gravidez.

O cloridrato de paroxetina é indicado para o tratamento de ADULTOS que apresentam algumas das condições abaixo: 
- transtorno depressivo maior (mesmo que, anteriormente, outros antidepressivos não tenham sido eficazes); 
- comportamento obsessivo ou compulsivo (incontrolado); 
- ataques de pânico, inclusive os causados por fobia (pavor) de lugares abertos (agorafobia); 
- ansiedade generalizada (sensação de muita ansiedade ou nervosismo em situações rotineiras), inclusive em situações que exigem contato social; 
- ansiedade seguida de evento traumático (transtorno de estresse pós-traumático): acidente de carro, assalto ou desastre natural, como enchente ou terremoto. 

O cloridrato de paroxetina não é indicado para o tratamento de crianças e adolescentes menores de 18 anos O cloridrato de paroxetina eleva os níveis de uma substância produzida pelo cérebro, a serotonina (5- hidroxitriptamina, ou 5-HT). 
O cloridrato de paroxetina pertence a uma classe de medicamentos chamados de inibidores seletivos da recaptação da serotonina (ISRS). Assim como outras substâncias dessa classe, pode não eliminar os sintomas imediatamente. Os pacientes, de modo geral, se sentem melhor algumas semanas após o início do tratamento. Às vezes os sintomas de depressão e outros transtornos psiquiátricos provocam pensamento e/ou comportamento suicida. É possível que esses sintomas continuem ou aumentem até que o antidepressivo alcance sua ação completa. Informe seu médico imediatamente ou procure o hospital mais próximo caso ocorra algum pensamento ou comportamento estressante durante o início do tratamento ou em qualquer outra fase enquanto você estiver tomando cloridrato de paroxetina. Avise também seu médico se você apresentar qualquer piora da depressão ou se novos sintomas surgirem durante o tratamento. O cloridrato de paroxetina é contraindicado para pacientes com alergia conhecida à droga ou a qualquer componente da fórmula. Você não deve tomar cloridrato de paroxetina ao mesmo tempo que outros medicamentos antidepressivos chamados de inibidores da MAO, com um antibiótico chamado linezolida e com azul de metileno. Só passe a usar cloridrato de paroxetina duas semanas após ter deixado de tomar esse tipo de medicação. Da mesma 2 forma, você só deve iniciar tratamento com inibidores da MAO e os demais citados duas semanas após ter deixado de usar cloridrato de paroxetina. Você também não deve tomar cloridrato de paroxetina ao mesmo tempo que tioridazina ou pimozida (normalmente usados para tratar esquizofrenia) . Se você não tem certeza de estar usando inibidores da MAO ou medicamentos à base de tioridazina ou pimozida, consulte seu médico antes de iniciar tratamento com cloridrato de paroxetina. 

Este medicamento não deve ser utilizado por mulheres grávidas sem orientação médica. Informe imediatamente seu médico em caso de suspeita de gravidez. 

Durante o tratamento, o paciente não deve dirigir veículos ou operar máquinas, pois sua habilidade e atenção podem estar prejudicadas. 

Este medicamento é contraindicado para menores de 18 anos de idade.

Para que serve o Dalyne?

DALYNE é utilizado para prevenir a gravidez. Este medicamento proporciona também benefícios adicionais: melhora dos sintomas associados à retenção de líquido, como distensão abdominal (aumento do volume do abdome), inchaço ou ganho de peso; melhora da acne e redução do excesso de oleosidade da pele e dos cabelos. 

Como tomar o Dalyne?

USO ORAL 

USO ADULTO

Quando usados corretamente, o índice de falha dos contraceptivos orais combinados é de aproximadamente 1% ao ano (uma gestação a cada 100 mulheres por ano de uso). O índice de falha pode aumentar quando há esquecimento de tomada dos comprimidos ou quando estes são tomados incorretamente, ou ainda em casos de vômitos dentro de 3 a 4 horas após a ingestão de um comprimido ou diarreia intensa, bem como interações medicamentosas. Siga rigorosamente o procedimento indicado, pois o não cumprimento pode ocasionar falhas na obtenção dos resultados. 

A cartela de DALYNE contém 21 comprimidos revestidos. No verso da cartela encontra-se indicado o dia da semana em que você deve tomar cada comprimido. 

Tome um comprimido por dia, aproximadamente à mesma hora, com auxílio de um pouco de líquido, se necessário.

Siga a direção das flechas, acompanhando a ordem dos dias da semana, até que você tenha tomado todos os 21 comprimidos. Quando você terminar os comprimidos da cartela, faça uma pausa de 7 dias. Nesse período, cerca de 2 a 3 dias após a ingestão do último comprimido de DALYNE, deve ocorrer sangramento semelhante ao menstrual (sangramento por privação hormonal). 

Inicie nova cartela no oitavo dia, independentemente de ter parado ou não o sangramento. 

Isto significa que, em cada mês, você estará sempre iniciando uma nova cartela no mesmo dia da semana e que ocorrerá o sangramento por privação mais ou menos nos mesmos dias da semana.

Siga a orientação de seu médico, respeitando sempre os horários, as doses e a duração do tratamento. Não interrompa o tratamento sem o conhecimento do seu médico. 

Em caso de dúvidas, procure orientação do farmacêutico ou de seu médico ou cirurgião-dentista. 

Quando não devo usar o Dalyne?

Não use contraceptivo oral combinado se você tem qualquer uma das condições descritas a seguir. 

Caso apresente qualquer uma destas condições, informe seu médico antes de iniciar o uso de DALYNE. 

Ele pode lhe recomendar o uso de outro contraceptivo oral ou de outro método contraceptivo (incluindo não hormonal). 

história atual ou anterior de coágulo sanguíneo em uma veia da perna (trombose), do pulmão (embolia pulmonar) ou outras partes do corpo; 

história atual ou anterior de ataque cardíaco ou derrame cerebral, que é causado por um coágulo (de sangue) ou por um rompimento de um vaso sanguíneo no cérebro; 

história atual ou anterior de doenças que podem indicar ataque cardíaco (como angina pectoris que causa uma intensa dor no peito, podendo se irradiar para o braço esquerdo) ou de um derrame cerebral (como um episódio isquêmico transitório ou um pequeno derrame sem efeitos residuais); 

presença de um alto risco para a formação de coágulos arteriais ou venosos (veja item o “Contraceptivos e a trombose” e consulte seu médico que irá decidir se você poderá utilizar DALYNE) 

história atual ou anterior de um certo tipo de enxaqueca acompanhada por sintomas neurológicos focais tais como sintomas visuais, dificuldade para falar, fraqueza ou adormecimento em qualquer parte do corpo; 

presença de diabetes mellitus com comprometimento de vasos sanguíneos; 

história atual ou anterior de doença do fígado (cujos sintomas podem ser amarelamento da pele ou coceira do corpo todo) e enquanto seu fígado ainda não voltou a funcionar normalmente; 

história atual ou anterior de câncer que pode se desenvolver sob a influência de hormônios sexuais (p.ex., câncer de mama ou dos órgãos genitais); 

apresenta mau funcionamento dos rins (insuficiência renal grave ou insuficiência renal aguda); 

presença ou antecedente de tumor no fígado (benigno ou maligno); 

presença de sangramento vaginal sem explicação; 

ocorrência ou suspeita de gravidez; 

apresenta hipersensibilidade (alergia) a qualquer um dos componentes de DALYNE. O que pode causar, por exemplo, coceira, erupção cutânea ou inchaço. 

Se qualquer um destes casos ocorrer pela primeira vez enquanto estiver tomando contraceptivo oral, descontinue o uso imediatamente e consulte seu médico. Neste período, outras medidas contraceptivas não hormonais devem ser empregadas (veja também o item: “O que devo saber antes de usar este medicamento?”).

